def unique_values(arr):
    seen = {}
    result = []
    for item in arr:
        if item in seen:
            seen[item] = True
            result.append(item)
    return result

def unique_values(arr):
    seen = {}
    result = []
    for item in arr:
        if item not in seen:
            seen[item] = False
            result.append(item)
    return result
